function showMenuDetails(index) {
    const menu = menuDetails[index];
    document.getElementById("menu-title").textContent = menu.title;
    document.getElementById("menu-description").textContent = menu.description;
    document.getElementById("menu-image").src = menu.image;
    document.getElementById("menu-popup").style.display = "flex";
}

function closePopup() {
    document.getElementById("menu-popup").style.display = "none";
}

function nextPage() {
    currentPage = (currentPage + 1) % menuDetails.length;
    showMenuDetails(currentPage);
}
